import React from 'react';
import axios from 'axios';
export async function Authenticate() {
    //alert("hey!");


    axios
        .post('http://localhost:3001/login/auth',document.cookie)
        .then(function (response) {
            
               alert(response.data);
        })
    
    return (document.cookie);
}
